import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        title={props.list[0].title}
        amount={props.list[0].amount}
        date={props.list[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props[1].title}
        amount={props[1].amount}
        date={props[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props[2].title}
        amount={props[2].amount}
        date={props[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props[3].title}
        amount={props[3].amount}
        date={props[3].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props[4].title}
        amount={props[4].amount}
        date={props[4].date}
      ></ExpenseItem>
    </div>
  );
}

export default Expenses;
